// src/components/Dashboard.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
    return (
        <div className="dashboard">
            <h1>Welcome to MEMES254KE Official!</h1>
            <img src="public/logonew.jpg" alt="Brand Logo" className="logo" />
            <p>
                Here at MEMES254KE, we create hilarious and relatable memes for everyone!
            </p>
            <h2>Navigate to:</h2>
            <ul>
                <li><Link to="/meme-generator">Random Meme Generator</Link></li>
                <li><Link to="/chat">Chat with Moderators</Link></li>
            </ul>
            <h3>Follow Us:</h3>
            <div className="social-media-links">
                <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Whatsapp</a>
                <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Telegram</a>
                <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a>
            </div>
        </div>
    );
};

export default Dashboard;
